      <div className={styles.menu}>
        <div className={styles.menuTitle}>Menu</div>
        <ul>
          <li>
            <a href="#">Menu</a>
          </li>
          <li>
            <a href="#">Waitlist</a>
          </li>
          <li>
            <a href="#">Gift Cards</a>
          </li>
          <li>
            <a href="#">Offers</a>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Menu;
